import { Box, Typography, Avatar } from "@mui/material";
import profilePic from "../assets/profilepic.png"; // Import the image

const AboutMe: React.FC = () => {
    return (
        <Box
            sx={{
                display: "flex",
                flexDirection: "row",
                alignItems: "center",
                justifyContent: "center",
                minHeight: "100vh", // Allow scrolling if content exceeds viewport
                backgroundColor: "transparent",
                padding: "2rem",
                gap: "2rem",
            }}
        >
            {/* Profile Picture */}
            <Avatar
                src={profilePic} // Use the imported image
                alt="Iva Park"
                sx={{
                    width: "10rem",
                    height: "12rem",
                    borderRadius: "0",
                    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
                }}
            />

            {/* About Me Text */}
            <Box>
                <Typography
                    variant="h4"
                    sx={{
                        fontWeight: "bold",
                        marginBottom: "1rem",
                        fontFamily: "'PT Sans Narrow', sans-serif",
                    }}
                >
                    About Me
                </Typography>
                <Typography
                    variant="body1"
                    sx={{
                        fontSize: "1.2rem",
                        lineHeight: "1.6",
                        fontFamily: "'PT Sans Narrow', sans-serif",
                    }}
                >
                    Iâ€™m a Junior at NYU studying Computer Science and Psychology.
                </Typography>
            </Box>
        </Box>
    );
};

export default AboutMe;
